    [],nt"revision_timestamp": "2016-07-27T23:01:43.152148",nt"name": "monitoring-populations-of-breeding-seabirds-final-report",nt"isopen":
    false,nt"url": null,nt"notes": "At Cape Thompson, Alaska, the University
    of Alaska, mapped locations of census plots during his 1959-61 studies (see Swartz
    1966) of the seabird colony there. Numbers of murres and Black-legged Kittiwakes
    have been estimated there in three years: 1960, 1976, and 1977. Actual census techniques
    have received considerable attention-in recent years. The primary purpose of this
    study is to examine the degree to which changes in numbers on plots reflect overall
    changes in numbers at the Cape Thompson rookery for murres and kittiwakes. Secondly
    the degree to which various types of plots, e.g. peripheral vs. central, reflect
    overall change will be examined. Contract no. 14-16-0001-78119, U.S. Fish & Wildlife
